-- drop and create databases

DROP DATABASE IF EXISTS `daiquiri_archive`;
CREATE DATABASE `daiquiri_archive`;

DROP DATABASE IF EXISTS `daiquiri_data_test`;
CREATE DATABASE `daiquiri_data_test`;

DROP DATABASE IF EXISTS `daiquiri_data_obs`;
CREATE DATABASE `daiquiri_data_obs`;

DROP DATABASE IF EXISTS `daiquiri_data_sim`;
CREATE DATABASE `daiquiri_data_sim`;

DROP DATABASE IF EXISTS `daiquiri_user_user`;
CREATE DATABASE `daiquiri_user_user`;

-- create tables

CREATE TABLE `daiquiri_archive`.`files` (
    `id` CHAR(36) PRIMARY KEY NOT NULL,
    `timestamp` TIMESTAMP NOT NULL,
    `file` CHAR(255) NOT NULL,
    `collection` CHAR(32) NOT NULL,
    `path` TEXT NOT NULL,
    `ra` FLOAT NOT NULL,
    `dec` FLOAT NOT NULL
) ENGINE=MyISAM;

CREATE TABLE `daiquiri_data_test`.`test` (
  `id` bigint primary key not null,
  `bool` TINYINT not null,
  `array` varchar(32) not null,
  `matrix` varchar(32) not null
);

CREATE TABLE `daiquiri_data_obs`.`stars` (
  `id` BIGINT PRIMARY KEY NOT NULL,
  `ra` DOUBLE NOT NULL,
  `dec` DOUBLE NOT NULL,
  `parallax` DOUBLE NOT NULL
) ENGINE=MyISAM;

CREATE TABLE `daiquiri_data_sim`.`halos` (
  `id` BIGINT PRIMARY KEY NOT NULL,
  `x` DOUBLE NOT NULL,
  `y` DOUBLE NOT NULL,
  `z` DOUBLE NOT NULL,
  `vx` DOUBLE NOT NULL,
  `vy` DOUBLE NOT NULL,
  `vz` DOUBLE NOT NULL,
  `mass` DOUBLE NOT NULL
) ENGINE=MyISAM;

CREATE TABLE `daiquiri_user_user`.`test` (
  `id` BIGINT,
  `ra` DOUBLE,
  `dec` DOUBLE,
  `parallax` DOUBLE
) ENGINE=MyISAM;

-- change permissions

GRANT SELECT ON `daiquiri_archive`.* TO 'daiquiri_data'@'localhost';
GRANT SELECT ON `daiquiri_data_test`.* TO 'daiquiri_data'@'localhost';
GRANT SELECT ON `daiquiri_data_obs`.* TO 'daiquiri_data'@'localhost';
GRANT SELECT ON `daiquiri_data_sim`.* TO 'daiquiri_data'@'localhost';

GRANT ALL PRIVILEGES ON `TAP_SCHEMA`.* TO 'daiquiri_data'@'localhost';
GRANT ALL PRIVILEGES ON `test_TAP_SCHEMA`.* TO 'daiquiri_data'@'localhost';

GRANT ALL PRIVILEGES ON `daiquiri_user_%`.* TO 'daiquiri_data'@'localhost';

